import React from "react";
import { useSelector } from "react-redux";

import { Modal } from "antd";
import { useDispatch } from "react-redux";
import "./Recipe.css";

const ReturnModal = () => {
  const dispatch = useDispatch();
  const { detailRecipe, status } = useSelector((state) => state.detailRecipe);

  console.log("detailRecipe: ", detailRecipe);

  const cancelHandle = () => {
    dispatch({ type: "CLOSE_RECIPE" });
  };

  return (
    <Modal
      wrapClassName=""
      visible={true}
      //   visible={status}
      onCancel={cancelHandle}
      footer={null}
    >
      {/* <div>{detailRecipe?.publisher}</div> */}
      <div style={{ height: "650px", backgroundColor: "#ff00001f" }}></div>
    </Modal>
  );
};

export default ReturnModal;
